import React from "react"

function TextInput({
  label,
  value,
  placeHolder,
  onChange,
  optionalOrRequired,
}) {
  return (
    <div className="text-input-container">
      {label && <label className="selector-label">{label}</label>}
      <input
        type="text"
        placeholder={placeHolder}
        value={value}
        onChange={onChange}
      />
      <p className="optional-or-required-p">{optionalOrRequired}</p>
    </div>
  )
}

export default TextInput
